<!DOCTYPE html>
<html lang="en">

<head>
    <meta charset="UTF-8">
    <meta name="viewport" content="width=device-width, initial-scale=1.0">
    <title>Rotating Diamond</title>
    <style>
        body {
            background-color: rgb(0, 0, 0);
        }

        #logo {
            position: absolute;
            top: 50%;
            left: 50%;
            transform: translate(-50%, -50%);
            animation: fill 1.1s ease forwards 1s;
        }

        #logo path:nth-child(1) {
            stroke-dasharray: 488px;
            stroke-dashoffset: 488px;
            animation: line-move 1s ease forwards;
        }

        #logo path:nth-child(2) {
            stroke-dasharray: 420px;
            stroke-dashoffset: 420px;
            animation: line-move 1s ease forwards;
        }

        #logo path:nth-child(3) {
            stroke-dasharray: 630px;
            stroke-dashoffset: 630px;
            animation: line-move 1s ease forwards;
        }

        #logo path:nth-child(4) {
            stroke-dasharray: 520px;
            stroke-dashoffset: 520px;
            animation: line-move 1s ease forwards;
        }

        #logo path:nth-child(5) {
            stroke-dasharray: 630px;
            stroke-dashoffset: 630px;
            animation: line-move 1s ease forwards;
        }


        #logo path:nth-child(6) {
            stroke-dasharray: 420px;
            stroke-dashoffset: 420px;
            animation: line-move 1s ease forwards;
        }

        #logo path:nth-child(7) {
            stroke-dasharray: 545px;
            stroke-dashoffset: 545px;
            animation: line-move 1s ease forwards;
        }

        #logo path:nth-child(8) {
            stroke-dasharray: 525px;
            stroke-dashoffset: 525px;
            animation: line-move 1s ease forwards;
        }

        #logo path:nth-child(9) {
            stroke-dasharray: 450px;
            stroke-dashoffset: 450px;
            animation: line-move 1s ease forwards;
        }

        @keyframes line-move {
            to {
                stroke-dashoffset: 0;
                stroke-dasharray: 0;
                stroke: black;
            }
        }

        @keyframes fill {
            from {
                fill: transparent;

            }

            to {
                fill: white;

            }
        }
    </style>

</head>
